tivo"=>"t", "id_fase"=>"1", "id_centro"=>"83", "id_comuna"=>NULL, "publicado"=>NULL, "id_com_etica"=>NULL, "id_inst_etica"=>NULL, "fecha_registro"=>"2020-07-28 19:24:51.391752", "id_tipo_comuna"=>NULL, "ci_investigador"=>"16033260", "id_unidad_tiempo"=>"3", "enlace_publicacion"=>NULL, "id_tipo_institucion"=>"3", "tiempo_investigacion"=>"5", "titulo_investigacion"=>"DESARROLLO DE LA EDUCACIN A DISTANCIA EN EL MBITO DE LA PERCUSIN AFROVENEZOLANA COMO MEDIO DEL CULTIVO DE LA SALUD FSICA, MENTAL Y ESPIRITUAL EN TIEMPOS DE PANDEMIA: HERENCIA, UNIVERSIDAD DEL TAMBOR DE VENEZUELA (UTV)", "id_tipo_investigacion"=>"4", "impacto_investigacion"=>NULL, "id_linea_investigacion"=>"7", "objetivo_investigacion"=>NULL, "id_investigacion_actual"=>"20", "resultado_investigacion"=>"CON NIMOS DE CONTEXTUALIZARNOS EN ESTOS TIEMPOS, COMO ESCUELA HERENCIA, QUEREMOS LLEGAR Y SEGUIR ENLAZNDONOS ENTRE PUEBLOS DESDE LOCAL A LO INTERNACIONAL, A TRAVS DE LA FORMACIN Y LA TECNOLOGA. EN TAL SENTIDO, ABRIMOS EL COMPS DE LA FORMACIN ORGNICA, PRESENCIAL Y DE ENCUENTRO DIRECTO A LA FORMACIN A DISTANCIA, MANTENIENDO NUESTRA ESENCIA ORGNICA QUE ASPIRA AL SENTIR Y VIVIR EL TAMBOR TRADICIONAL VENEZOLANO, AFROCONTEMPORNEO Y AFROURBANO, CONSTITUYENDO LO QUE HEMOS DENOMINADO HERENCIA, LA UNIVERSIDAD DEL TAMBOR DE VENEZUELA (UTV).\nEN ESE SENTIDO, LA FORMACIN EN HERENCIA EST VINCULADA CON LA POTENCIALIZACIN DE LA SALUD FSICA Y MENTAL A PARTIR DEL ARRAIGO A LAS TRADICIONES, LA ESPIRITUALIDAD Y METODOLOGAS PROPIAS CULTIVADAS POR EL MAESTRO MANUEL MORENO. LA INVESTIGACIN ENTONCES BUSCA HACER LA MIGRACIN AL MBITO DIGITAL DE TODO AQUELLO QUE SE IMPULSA PRESENCIALMENTE.\nCOADYUVAR A LA FORMACIN EN LNEA EN VENEZUELA, YA QUE TENEMOS 21 AOS ININTERRUMPIDOS DESARROLLANDO GENERACIONES DE INTERESADOS E INTERESADAS EN LA PERCUSIN HERENCIA, QUE EN HERENCIA ES UN MODO DE VIVIR EL TAMBOR Y A ESCALA INTERNACIONAL COMO LOS PASES DE EL CARIBE, DEL CUAL YA TENEMOS CONVERSACIONES ADELANTADAS QUE PARA SU FOMENTO ES FUNDAMENTAL LA 