EZA, HIERRO Y MANGANESO, SALINIDAD Y COLIFORMES TOTALES Y TERMORRESISTENTES EST COMPUESTO POR PROCESOS DE ABLANDAMIENTO, FILTRACIN, AIREACIN, DESALINIZACIN Y DESINFECCIN.\nLAS TECNOLOGAS DE TRATAMIENTO QUE COMPONEN DICHOS PROCESOS ESTN CONSTITUIDAS POR ABLANDAMIENTO CON CAL, AIREACIN-FILTRACIN A PRESIN, SMOSIS INVERSA Y CLORACIN.	f		4	4	t	2020-07-17 18:28:31.34154
