--
-- Name: v_investigadores; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.v_investigadores AS
 SELECT a.id_investigador,
    a.ci_investigador,
    a.pnombre,
    a.snombre,
    a.papellido,
    a.sapellido,
    upper((b.nombre_genero)::text) AS nombre_genero,
    a.fecha_nac,
    upper((c.nombre_estado)::text) AS nombre_estado,
    d.estado,
    e.municipio,
    f.parroquia,
    g.codigo_postal,
    a.telefono,
    a.celular,
    a.correo,
    upper((h.profesion)::text) AS profesion,
    upper((i.tipo_institucion)::text) AS tipo_institucion,
    a.nombre_institucion,
    upper((j.modo_investigacion)::text) AS modo_investigacion,
        CASE
            WHEN a.activo THEN 'ACTIVO'::text
            ELSE 'INACTIVO'::text
        END AS activo,
    a.fecha_creacion
   FROM (((((((((public.investigadores a
     LEFT JOIN public.genero b ON ((b.id_genero = a.id_genero)))
     LEFT JOIN public.estado_civil c ON ((a.id_civil = c.id_estado_civil)))
     LEFT JOIN public.estados d ON ((a.id_estado = d.id_estado)))
     LEFT JOIN public.municipios e ON (((a.id_estado = e.id_estado) AND (a.id_municipio = e.id_municipio))))
     LEFT JOIN public.parroquias f ON (((a.id_municipio = f.id_municipio) AND (a.id_parroquia = f.id_parroquia))))
     LEFT JOIN public.zonas g ON (((a.id_parroquia = g.id_parroquia) AND (a.id_zona = g.id_zona))))
     LEFT JOIN public.profesiones h ON ((h.id_profesion = a.id_profesion)))
     LEFT JOIN public.tipo_institucion i ON ((i.id_tipo_institucion = a.id_tipo_institucion)))
     LEFT JOIN public.modo_investigacion j ON ((j.id_modo_investigacion = a.id_modo_investifgacion)))
  WHERE a.activo
  ORDER BY a.id_investigador;


ALTER TABLE public.v_investigadores OWNER TO postgres;

--
-- Name: vinteres_investigacion; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vinteres_investigacion AS
 SELECT ct.ci_investigador,
    ct.linea_inv1,
    ct.linea_inv2,
    ct.linea_inv3
   FROM public.crosstab('SELECT a.ci_investigador,($$linea$$ || b.id_lineas_presidenciales) as key,b.nombre_lineas_presidenciales::text FROM (SELECT ci_investigador,unnest(interes_inv) id_linea FROM investigadores) as a LEFT JOIN lineas_presidenciales b on b.id_lineas_presidenciales::text=a.id_linea order by 1,2'::text) ct(ci_investigador integer, linea_inv1 text, linea_inv2 text, linea_inv3 text);


ALTER TABLE public.vinteres_investigacion OWNER TO postgres;

--
-- Name: vinvestigacion_actual; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vinvestigacion_actual AS
 SELECT a.id_investigacion_actual,
    a.ci_investigador,
    a.titulo_investigacion,
    b.tipo_institucion,
        CASE
            WHEN (a.id_tipo_institucion = 1) THEN h.nombre_centro
            WHEN (a.id_tipo_institucion = 2) THEN i.nombre_institucion_investigacion
            WHEN (a.id_tipo_institucion = 3) THEN j.nombre_institucion_educativa
            WHEN (a.id_tipo_institucion = 4) THEN k.comuna
            ELSE NULL::character varying
        END AS centro,
    d.nombre_lineas_presidenciales AS linea_investigacion,
    a.resultado_investigacion,
    e.tipo_investigacion,
    f.fase,
    ((a.tiempo_investigacion || ' '::text) || (g.unidad_tiempo)::text) AS tiempo_investigacion,
    a.objetivo_investigacion,
        CASE
            WHEN ((a.id_inst_etica = 1) AND (a.id_com_etica IS NULL)) THEN l.nombre_centro
            WHEN ((a.id_inst_etica = 2) AND (a.id_com_etica IS NULL)) THEN m.nombre_institucion_investigacion
            WHEN ((a.id_inst_etica = 3) AND (a.id_com_etica IS NULL)) THEN n.nombre_institucion_educativa
            WHEN ((a.id_inst_etica = 4) AND (a.id_com_etica IS NULL)) THEN o.comuna
            WHEN ((a.id_com_etica = 1) AND (a.id_inst_etica IS NULL)) THEN l.nombre_centro
            WHEN ((a.id_com_etica = 2) AND (a.id_inst_etica IS NULL)) THEN m.nombre_institucion_investigacion
            WHEN ((a.id_com_etica = 3) AND (a.id_inst_etica IS NULL)) THEN n.nombre_institucion_educativa
            WHEN ((a.id_com_etica = 4) AND (a.id_inst_etica IS NULL)) THEN o.comuna
            ELSE NULL::character varying
        END AS institucion_etica,
    a.impacto_investigacion,
        CASE
            WHEN a.publicado THEN 'SI'::text
            ELSE 'NO'::text
        END AS publicado,
    a.enlace_publicacion,
        CASE
            WHEN a.activo THEN 'SI'::text
            ELSE 'NO'::text
        END AS activo,
    a.fecha_registro
   FROM (((((((((((((((((public.investigacion_actual a
     LEFT JOIN public.tipo_institucion b ON ((b.id_tipo_institucion = a.id_tipo_institucion)))
     LEFT JOIN public.lineas_presidenciales d ON ((d.id_lineas_presidenciales = a.id_linea_investigacion)))
     LEFT JOIN public.tipo_investigacion e ON ((e.id_tipo_investigacion = a.id_tipo_investigacion)))
     LEFT JOIN public.fases f ON ((f.id_fase = a.id_fase)))
     LEFT JOIN public.unidades_tiempo g ON ((g.id_unidad_tiempo = a.id_unidad_tiempo)))
     LEFT JOIN public.centros_salud h ON ((h.id_centro_salud = a.id_centro)))
     LEFT JOIN public.instituciones_investigacion i ON ((i.id_institucion_investigacion = a.id_centro)))
     LEFT JOIN public.instituciones_educativas j ON ((j.id_institucion_educativa = a.id_centro)))
     LEFT JOIN public.comunas k ON ((k.id_comuna = a.id_centro)))
     LEFT JOIN public.centros_salud l ON ((l.id_centro_salud = a.id_centro)))
     LEFT JOIN public.instituciones_investigacion m ON ((m.id_institucion_investigacion = a.id_centro)))
     LEFT JOIN public.instituciones_educativas n ON ((n.id_institucion_educativa = a.id_centro)))
     LEFT JOIN public.comunas o ON ((o.id_comuna = a.id_centro)))
     LEFT JOIN public.centros_salud p ON ((p.id_centro_salud = a.id_centro)))
     LEFT JOIN public.instituciones_investigacion q ON ((q.id_institucion_investigacion = a.id_centro)))
     LEFT JOIN public.instituciones_educativas r ON ((r.id_institucion_educativa = a.id_centro)))
     LEFT JOIN public.comunas s ON ((s.id_comuna = a.id_centro)))
  ORDER BY a.id_investigacion_actual;


ALTER TABLE public.vinvestigacion_actual OWNER TO postgres;

