CREATE VIEW public.vperfil_investigacion AS
 SELECT a.id_perfil_investigacion,
    a.ci_investigador,
        CASE
            WHEN a.politica_publica THEN 'SI'::text
            ELSE 'NO'::text
        END AS impacto_politica_publica,
    b.politica_publica,
    d.linea_investigacion,
    e.tipo_investigacion,
    f.fase,
    g.tipo_institucion,
        CASE
            WHEN (a.id_tipo_institucion = 1) THEN i.nombre_centro
            WHEN (a.id_tipo_institucion = 2) THEN j.nombre_institucion_investigacion
            WHEN (a.id_tipo_institucion = 3) THEN k.nombre_institucion_educativa
            WHEN (a.id_tipo_institucion = 4) THEN l.comuna
            ELSE NULL::character varying
        END AS centro,
    a.titulo_investigacion,
    a.fecha_culminacion,
    a.objetivo_investigacion,
    a.resultado_investigacion,
        CASE
            WHEN a.publicada THEN 'SI'::text
            ELSE 'NO'::text
        END AS publicada,
    a.link_publicacion,
    ((a.tiempo_investigacion || ' '::text) || (h.unidad_tiempo)::text) AS tiempo_investigacion,
        CASE
            WHEN a.activo THEN 'SI'::text
            ELSE 'NO'::text
        END AS activo,
    a.fecha_registro
   FROM ((((((((((public.perfil_investigacion a
     LEFT JOIN public.politicas_publicas b ON ((b.id_politica_publica = a.id_politica_publica)))
     LEFT JOIN public.lineas_investigacion d ON ((d.id_linea_investigacion = a.id_linea_investigacion)))
     LEFT JOIN public.tipo_investigacion e ON ((e.id_tipo_investigacion = a.id_tipo_investigacion)))
     LEFT JOIN public.fases f ON ((f.id_fase = a.id_fase)))
     LEFT JOIN public.tipo_institucion g ON ((g.id_tipo_institucion = a.id_tipo_institucion)))
     LEFT JOIN public.unidades_tiempo h ON ((h.id_unidad_tiempo = a.id_unidad_tiempo)))
     LEFT JOIN public.centros_salud i ON ((i.id_centro_salud = a.id_centro)))
     LEFT JOIN public.instituciones_investigacion j ON ((j.id_institucion_investigacion = a.id_centro)))
     LEFT JOIN public.instituciones_educativas k ON ((k.id_institucion_educativa = a.id_centro)))
     LEFT JOIN public.comunas l ON ((l.id_comuna = a.id_centro)));


ALTER TABLE public.vperfil_investigacion OWNER TO postgres;

--
-- Name: vperfil_investigador; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.vperfil_investigador AS
 SELECT a.id_perfil_investigador,
    a.ci_investigador,
    b.pnombre,
    b.snombre,
    b.papellido,
    b.sapellido,
    a.rif_investigador,
    c.nivel_academico,
    d.estatus_academico,
    e.nombre_institucion_educativa,
    f.nombre_especialidad_salud,
    g.area_conocimiento,
    h.sub_area,
        CASE
            WHEN a.consigno_cedula THEN 'SI'::text
            ELSE 'NO'::text
        END AS consigno_cedula,
        CASE
            WHEN a.consigno_rif THEN 'SI'::text
            ELSE 'NO'::text
        END AS consigno_rif,
        CASE
            WHEN a.consigno_foto THEN 'SI'::text
            ELSE 'NO'::text
        END AS consigno_foto,
        CASE
            WHEN a.consigno_titulo THEN 'SI'::text
            ELSE 'NO'::text
        END AS consigno_titulo,
        CASE
            WHEN a.activo THEN 'SI'::text
            ELSE 'NO'::text
        END AS activo,
    a.fecha_creacion
   FROM (((((((public.perfil_investigador a
     LEFT JOIN public.investigadores b ON ((b.ci_investigador = a.ci_investigador)))
     LEFT JOIN public.nivel_academico c ON ((c.id_nivel_academico = a.id_nivel_academico)))
     LEFT JOIN public.estatus_academico d ON ((d.id_estatus_academico = a.id_estatus_academico)))
     LEFT JOIN public.instituciones_educativas e ON ((e.id_institucion_educativa = a.id_institucion_educativa)))
     LEFT JOIN public.especialidades_salud f ON ((f.id_especialidad_salud = a.id_especialidad_salud)))
     LEFT JOIN public.areas_conocimiento g ON ((g.id_area_conocimiento = a.id_area_conocimiento)))
     LEFT JOIN public.sub_areas h ON ((h.id_sub_area = a.id_sub_area)))
  ORDER BY a.id_perfil_investigador;


ALTER TABLE public.vperfil_investigador OWNER TO postgres;

